create table customers (
	id INT primary key auto_increment,
	first_name VARCHAR(50) not null,
	last_name VARCHAR(50),
	gender VARCHAR(50),
	email VARCHAR(50) UNIQUE ,
	phone VARCHAR(50) UNIQUE ,
	street VARCHAR(50),
	city VARCHAR(50),
	state VARCHAR(50),
	postal_code VARCHAR(50),
	country VARCHAR(50)
);
